import React, { Component } from "react";

class Fridge extends Component {
  render() {
    return (<ul>
      {this.props.lists.map((list) => (
        <BuyList
          key={list.id}
          item={list}
          toggleSelect={this.props.toggleSelect}
          deleteItem={this.props.deleteItem}
        />
      ))}
    </ul>);
  }
}

export default Fridge;
